import React, { Component } from "react";
import Slider from "react-slick";
import projectContent from "./ProjectContent"
import bar from "../images/footer-bg.jpg"





export default class Resizable extends Component {

  constructor(props) {
    super(props);
    this.next = this.next.bind(this);
    this.previous = this.previous.bind(this);
  }

  next() {
    this.slider.slickNext();
  }
  previous() {
    this.slider.slickPrev();
  }
  state = {
    display: true,
    width: 600,
 


            
     
 
  };
  render() {


    const settings = {
      arrows:false,
      dots: false,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 1,
      responsive: [
        {
          breakpoint: 1199,
          settings: {
            slidesToShow: 2,
            slidesToScroll: 1,
            infinite: true,
            dots: false
          }
        },
        {
          breakpoint: 991,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            infinite: true,
            dots: false
          }
        },
        {
          breakpoint: 600,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1,
            initialSlide: 1
          }
        },
        {
          breakpoint: 480,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        },
        {
          breakpoint: 395,
          settings: {
            slidesToShow: 1,
            slidesToScroll: 1
          }
        
        },
        {
          breakpoint: 320,
          settings: {
            slidesToShow: .95,
            slidesToScroll: 1
          }
        }
      ]
    };

    return (
   
     <div>
         <div className="container">

         <h5>OUR PORTOFOLIO</h5>
         <h1>See Our Recent Projects</h1>
         <img src={bar}/>
     </div>
     </div>

    );
  }
}
